sql:
SELECT
  `Game`,
  `Record`
FROM `table_1_11907963_6`
WHERE
  (
    SUBSTR(`Record`, 1, INSTR(`Record`, '–') - 1) * 1.0
  ) / (
    SUBSTR(`Record`, 1, INSTR(`Record`, '–') - 1) + SUBSTR(`Record`, INSTR(`Record`, '–') + 1)
  ) < 0.35;

